pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract MilkTrace is AccessControl {
    bytes32 public constant MANUFACTURER_ROLE = keccak256("MANUFACTURER_ROLE");
    bytes32 public constant COLLECTOR_ROLE    = keccak256("COLLECTOR_ROLE");
    bytes32 public constant CUSTOMS_ROLE      = keccak256("CUSTOMS_ROLE");
    bytes32 public constant RETAILER_ROLE     = keccak256("RETAILER_ROLE");

    enum Status { Init, Produced, Collected, Cleared, Retail }

    struct Product {
        string name;
        string batch;
        uint64 mfgDate;
        Status status;
        bool exists;
    }

    mapping(bytes32 => Product) private products;
    mapping(bytes32 => Status[]) private statusHistory;
    mapping(bytes32 => uint256[]) private timeHistory;

    event ProductRegistered(bytes32 indexed productId, string name, string batch, uint64 mfgDate);
    event TraceUpdated(bytes32 indexed productId, Status newStatus, uint256 timestamp);

    constructor(address admin) {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
    }

    function registerProduct(bytes32 productId, string calldata name, string calldata batch, uint64 mfgDate)
        external
        onlyRole(MANUFACTURER_ROLE)
    {
        require(!products[productId].exists, "Already exists");
        products[productId] = Product({name: name, batch: batch, mfgDate: mfgDate, status: Status.Produced, exists: true});
        statusHistory[productId].push(Status.Produced);
        timeHistory[productId].push(block.timestamp);
        emit ProductRegistered(productId, name, batch, mfgDate);
        emit TraceUpdated(productId, Status.Produced, block.timestamp);
    }

    function setCollected(bytes32 productId) external onlyRole(COLLECTOR_ROLE) {
        _advance(productId, Status.Collected, Status.Produced);
    }

    function setCleared(bytes32 productId) external onlyRole(CUSTOMS_ROLE) {
        _advance(productId, Status.Cleared, Status.Collected);
    }

    function setRetail(bytes32 productId) external onlyRole(RETAILER_ROLE) {
        _advance(productId, Status.Retail, Status.Cleared);
    }

    function _advance(bytes32 productId, Status target, Status requiredPrev) internal {
        require(products[productId].exists, "No product");
        require(products[productId].status == requiredPrev, "Wrong order");
        products[productId].status = target;
        statusHistory[productId].push(target);
        timeHistory[productId].push(block.timestamp);
        emit TraceUpdated(productId, target, block.timestamp);
    }

    function getProduct(bytes32 productId) external view returns (Product memory) {
        require(products[productId].exists, "No product");
        return products[productId];
    }

    function getHistory(bytes32 productId) external view returns (Status[] memory, uint256[] memory) {
        require(products[productId].exists, "No product");
        return (statusHistory[productId], timeHistory[productId]);
    }

    function grantMany(bytes32 role, address[] calldata addrs) external onlyRole(getRoleAdmin(role)) {
        for (uint i = 0; i < addrs.length; i++) _grantRole(role, addrs[i]);
    }
}
